from typing import List

def buy_maximum_stocks(price: List[int], k: int) -> int:
    prices = [(val, i) for (i, val) in enumerate(price, start=1)]
    prices.sort(key=lambda x: (x[0], -x[1]))
    cnt = 1
    for (val, i) in prices:
        if i * val <= k:
            cnt += i
            k -= i * val
        else:
            temp = k // val
            k -= temp * val
            cnt += temp
        if k == 0:
            break
    return cnt

